class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Verifies that after adding a specialty, getSpecialtiesInternal returns the set containing that specialty")
	void testGetSpecialtiesInternalReturnsSetWithSpecialties() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that multiple calls to getSpecialtiesInternal return the same instance of the set")
	void testGetSpecialtiesInternalReturnsSameInstance() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getSpecialties returns an empty list when Vet has no specialties")
	void testGetSpecialtiesReturnsEmptyList() {
		var result = instance.getSpecialties();
		assertTrue(result.isEmpty());
	}

	@Test
	@DisplayName("Verifies that getSpecialties throws NullPointerException when a specialty has a null name, causing sort failure")
	void testGetSpecialtiesThrowsExceptionOnNullName() {
		assertDoesNotThrow(() -> {
			instance.getSpecialties();
		});
	}

	@Test
	@DisplayName("Verifies that getNrOfSpecialties returns the correct number when multiple specialties are added to a Vet instance")
	void testGetNrOfSpecialtiesWithMultipleSpecialties() {
		// STEP 1: Create and add 3 specialties to the Vet instance
		Specialty specialty1 = new Specialty();
		Specialty specialty2 = new Specialty();
		Specialty specialty3 = new Specialty();
		instance.addSpecialty(specialty1);
		instance.addSpecialty(specialty2);
		instance.addSpecialty(specialty3);

		// STEP 2: Now retrieve the number of specialties
		var result = instance.getNrOfSpecialties();
		assertEquals(3, result);
	}

	@Test
	@DisplayName("Verifies that getNrOfSpecialties returns 0 when no specialties are added to a Vet instance")
	void testGetNrOfSpecialtiesWithNoSpecialties() {
		var result = instance.getNrOfSpecialties();
		assertEquals(0, result);
	}

	@Test
	@DisplayName("Tests adding a null specialty and verifies it is handled by the internal list")
	void testAddSpecialtyWithNull() {
		instance.addSpecialty(null);
	}

}

